import { connect } from "react-redux";
import { sendOtp } from "../../reducers/account/enterOtp.Reducer";
import { checkOtp } from "../../reducers/account/enterOtp.Reducer";
import EnterOtp from "../../components/account/EnterOtp.Component";

const mapStateToProps = (state) => ({
  statusEnterOtp: state.enterOtp.statusEnterOtp,
  isLoading: state.enterOtp.isLoading,
  error: state.enterOtp.error,
});

const mapActionToProps = { sendOtp, checkOtp };

export default connect(mapStateToProps, mapActionToProps)(EnterOtp);
